import React from "react";

import "./header.scss";
import { Button } from "../index";

interface IProps {
  store?: any;
}

const Header: React.FC<IProps> = ({ store }) => {
  return (
    <header>
      <div className="logo">
        <img src="/static/logo.svg" alt="" />
      </div>

      <nav>
        <a href="">Ana Sayfa</a>
        <a href="">En Çok Satanlar</a>
        <a href="">En Beğenilenler</a>
      </nav>

      <Button />
    </header>
  );
};

export default Header;
